import React from "react";

function PokemonIncrease() {
  const [Loaded, setLoaded] = useState(9);

  function incrementLoaded() {
    setLoaded((prevLoaded) => prevLoaded + 1);
    console.log(Loaded);
  }

  <div>
    <button onClick={incrementLoaded}>Click</button>
  </div>;
}
export default PokemonIncrease;
